import { useParams } from "react-router-dom";
import { Box } from "@mui/material";

import { Videos, ChannelCard } from "./";
import { fetchFromAPI } from "../utils/fetchFromAPI";


const ChannelDetailComp = () => {
  const {id} = useParams()
  return (
    <div>{id}</div>
  )
}

export default ChannelDetailComp
